/**
in registeration contract , i want to call register fucntion that let e create new user wallet account 
 */
contract UserWalletContract is Ownable{
TokenFactory public factory ;
Registration public registration;
    // using SafeERC20 for IERC20;

 using SafeMath for uint;
 AtaaToken public attaToken;
mapping (address=>uint) tokenInWallet;
address[] issuedTokens;
constructor(address owner , Registration _registration ,TokenFactory _factory ,AtaaToken _attaToken )public Ownable (owner) {
   attaToken = _attaToken;
    registration = _registration;
    factory = _factory;

}

modifier onlyOrg(address ChrtyOrg){
    require(registration.isOrg(ChrtyOrg));
    _;
}


// function buyWithCrypto(string memory proofOfpayment ) onlyOwner{

// }
// function buyWithFait() onlyOwner{

// }
// user should add the token factory to allownence with the amount of token he wants to exchange
function exchange(NewToken tokenToBuy , NewToken tokenToSell , uint256 amount) public onlyOwner {
    // get attacoin amount based on their rate 
            require(tokenToSell.balanceOf(address(this)) >= amount, "More Funds are needed.");
            tokenToSell.approve(address(attaToken),amount);
                uint256 rate = tokenToSell.rate();

            uint256 attaAmount = amount.div(rate);
           require(factory. sendTokenToFactory( tokenToSell  ,  amount ),"faild in exchange token with atta token in factory");
           require( _sendAttaTokenToContract(address(tokenToBuy),amount),"couldn't approve ");
               require( tokenToBuy.buyWithAttaCoin(attaAmount)," couldn't buy new token with atta coint");


}
// org can call it to create new tokens
// createNewToken(string memory name, string memory symbol, uint8 decimals, uint256  toPayAtaa, uint256 price)
function createNewToken(string memory  name, string memory symbol, uint8 decimals, uint256  toPayAtaa, uint256 price)  public onlyOwner onlyOrg(address(this)) returns (bool){
require( _sendAttaTokenToContract(address(factory),toPayAtaa),"couldn't send tokens to factory");
issuedTokens.push(factory.createNewToken(  name, symbol, decimals,  toPayAtaa, price));
return true;

}
function getIssuedTokens() public view returns (address []memory){
    return issuedTokens;
}

function _sendAttaTokenToContract( address contractAddress,uint256 amount) internal returns (bool) {
     attaToken.approve(contractAddress,amount);
     return true;


}
